import data, { NO_PROJECT } from "../data/data"
import Project from "../components/Project"
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/styles.css';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';

const projectType = (project) => {
    if (project == NO_PROJECT) {
        return true
    }
    return false
}
const projects = new Array();
const noprojects = new Array();

(function(){


    Object.keys(data).map ((project, idx) => {
        if (project !== NO_PROJECT) {
            projects.push(project)
                        //<Project key={idx} project={project} notes={data[project]}/>)
                        //console.log("notes: ", data[project]);
        } else {
            noprojects.push(<Project key={idx} project={project} notes={data[project]}/>);
        }

    })
})();

const App = () =>{
    // <p>Components go here</p>
    return ( <div>
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand>Notes</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <NavDropdown title="Projects" id="basic-nav-dropdown">
                                { Object.keys(projects).map((project,idx) => 
                                <NavDropdown.Item href="#action/3.1">
                                <Project key={idx} project={project} notes={data[project]}/>
                            </NavDropdown.Item>)}
                            </NavDropdown>
                            <Nav.Link href="#features">
                                {noprojects}
                            </Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>

            </div>
    )
}


export default App;
